import React, { Fragment } from 'react';

function RowData(props) {

    

  return <Fragment>
      <tr><td>{props.Id}</td>
            <td>{props.Surname}</td>
            <td>{props.FullName}</td>
            <td>{props.City}</td>
            <td>{props.Amount}</td>
          </tr>
  </Fragment>;
}

export default RowData;
